DROP TABLE IF EXISTS `es_goods_gallery`;
CREATE TABLE `es_goods_gallery` (
  `img_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `goods_id` int(10) DEFAULT NULL COMMENT '商品主键',
  `thumbnail` varchar(255) DEFAULT NULL COMMENT '缩略图路径',
  `small` varchar(255) DEFAULT NULL COMMENT '小图路径',
  `big` varchar(255) DEFAULT NULL COMMENT '大图路径',
  `original` varchar(255) DEFAULT NULL COMMENT '原图路径',
  `tiny` varchar(255) DEFAULT NULL COMMENT '极小图路径',
  `isdefault` int(1) DEFAULT NULL COMMENT '是否是默认图片1   0没有默认',
  `sort` int(2) DEFAULT NULL COMMENT '排序',
  PRIMARY KEY (`img_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1931 DEFAULT CHARSET=utf8 COMMENT='商品相册(es_goods_gallery)';

